import React, { Component } from 'react'
import DisplayInfo from './DisplayInfo'
import GeneralInfo from './GeneralInfo'

class Main extends Component {
  constructor(props) {
    super(props)

    this.state = {
       firstName:'',
       lastName:'',
       title:'',
       address:'',
       phonenr:'',
       email:'',
       description:''
    }

    this.handleInput = this.handleInput.bind(this);
    this.handleInputLn = this.handleInputLn.bind(this);
    this.handleInputTt = this.handleInputTt.bind(this);
    this.handleInputAd = this.handleInputAd.bind(this);
    this.handleInputPn = this.handleInputPn.bind(this);
    this.handleInputMail = this.handleInputMail.bind(this);
    this.handleInputDesc = this.handleInputDesc.bind(this);
  }
//INPUTSSSSS-------------------------------------------
  handleInput(e){
    this.setState({
      firstName:e.target.value
    })
  }

  handleInputLn(e){
    this.setState({
      lastName:e.target.value
    })
  }

  handleInputTt(e){
    this.setState({
      title:e.target.value
    })
  }

  handleInputAd(e){
    this.setState({
      address:e.target.value
    })
  }

  handleInputPn(e){
    this.setState({
      phonenr:e.target.value
    })
  }

  handleInputMail(e){
    this.setState({
        email:e.target.value
    })
  }

  handleInputDesc(e){
    this.setState({
      description:e.target.value
    })
  }
  //INPUUUUTSSSSS---------------------------------------
  render() {
    return (
      <div>
        <GeneralInfo handleInput={this.handleInput}/>
        <DisplayInfo firstName={this.state.firstName}/>


      </div>
    )
  }
}

export default Main
